import React from 'react';
import './About.css';
import { Card, CardHeader, CardBody, CardFooter, Text, Box, Heading, Stack } from '@chakra-ui/react';

function About() {
  return (
    <div className='about'>
        <Stack spacing='4'>
            {['elevated', 'outline', 'filled', 'unstyled'].map((variant) => (
                <Card key={variant} variant={variant}>
                <CardHeader>
                    <Heading size='md'> {variant}</Heading>
                </CardHeader>
                <CardBody>
                    <Text>variant = {variant}</Text>
                </CardBody>
                </Card>
            ))}
        </Stack>
    </div>
  )
}

export default About
